('2437','2','8365','James',Null,'Moderne Wohnung in 1. Meereslinie in Magaluff zu verkaufen','34190','Diese ca. 190m² große moderne Wohnung wurde 2015 saniert und befindet sich direkt am Paseo Magaluff in 1. Meereslinie und am Strand. Die ca 190m² Wohnfläche verteilt sich auf ein helles Wohn-Esszimmer mit schicker, offener Einbauküche, 4 Schlafzimmer, 4 Badezimmer. Eine ca 200m² große Terrasse lädt zum Relaxen ein. Im angeschlossenen Hotel kann man den Pool mitbenutzen. Zur Wohnung gehören noch 2 Tiefgaragenplätze mit Garagentor. Die perfekte Raumtemperatur wird über eine Klimaanlage w/k geregelt. Der Strand liegt direkt vor der Wohnun','34191','1100000','106','2016-03-16 16:12:55','106','2016-03-16 16:13:27',Null,'2585','99','1213',1,'1','0',Null,Null,Null,'34192',Null,'0','0','0',Null,'2016-03-16 16:19:53',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34193',Null,'34194',Null,'34195',Null,'34196',Null,'34197','0',0,'0');
